import React from "react";
import { Button , Nav, Navbar, Container} from 'react-bootstrap';
import Label from '@material-ui/core';
import './nav.css';
import './loader.css'
function NavBar(){

    return (

            <Navbar bg="dark" variant="dark">
    <Container>
    <centre><Navbar.Brand  href="#home">Medium.com Crawler</Navbar.Brand></centre>
    <middle><Navbar.Brand  href="#home">Easy Way for you to find your favorite blogs by Tags.</Navbar.Brand></middle>  

    </Container>
  </Navbar>

    );
}

export default NavBar;
